import React from "react";

import PageHeading from "../components/PageHeading";

const HomePage: React.FC = () => {
  return (
    <div>
      <PageHeading
        heading={
          "Ever got stuck on something? AskProgramming is the ultimate place to ask!"
        }
      />
    </div>
  );
};

export default HomePage;
